import React from 'react'
import ReactDOM from 'react-dom';
import Name from './App';
// import * as Com from './App'
import MYself  from './App';



ReactDOM.render(

    <>
        <ol>
            <li>{Name}</li>
            <li> {MYself()}</li>
        </ol>

    </>,
    document.getElementById('root')
);
